import React from "react";

const Footer = () => {
  return (
    <footer className="footer py-5">
      <div className="container">
        <div className="row">
            <div className="col-md-4">
            <ul>
                <li>الرئي</li>
                <li></li>
                <li></li>
                <li></li>
            </ul>
            </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
